import React, { useState, useEffect } from "react";

var ByDate = () => {
    const [info, setInfo] = useState(null);
    getInfo();
    async function getInfo() {
      const res = await fetch(`https://api.nasa.gov/planetary/apod?api_key=m5qSFJLeqz6oshoKMC0S8QChxUfWerz4VdqOiFo8`);
      const dataNew = await res.json();
     setInfo(dataNew);
      console.log(dataNew);
    }
  return (
    <>
      <div class="form-control">
        <label class="label">
          <span class="label-text">Search by date</span>
        </label>
        <div class="relative">
          <input
            type="text"
            placeholder="YYYY-MM-DD"
            class="w-full pr-16 input input-primary input-bordered"
          />
          <button class="absolute top-0 right-0 rounded-l-none btn btn-primary">
            go
          </button>
        </div>
      </div>
    </>
  );
};
export default ByDate;
